// Determine Browswer Types Etc.
function BrowserCheck() {
    var b = navigator.appName
    if (b=="Netscape") this.b = "ns"
    else if (b=="Microsoft Internet Explorer") this.b = "ie"
    else this.b = b
    this.v = parseInt(navigator.appVersion)
    this.ns = (this.b=="ns" && this.v>=4)
    this.ns4 = (this.b=="ns" && this.v==4)
    this.ns5 = (this.b=="ns" && this.v==5)
    this.ns6 = (this.b=="ns" && this.v==6)
    this.ie = (this.b=="ie" && this.v>=4)
    this.ie4 = (navigator.userAgent.indexOf('MSIE 4')>0)
    this.ie5 = (navigator.userAgent.indexOf('MSIE 5.0')>0)
    this.ie55 = (navigator.userAgent.indexOf('MSIE 5.5')>0)
    this.ie6 = (navigator.userAgent.indexOf('MSIE 6')>0)
    this.ie7 = (navigator.userAgent.indexOf('MSIE 7')>0)
    this.ie8 = (navigator.userAgent.indexOf('MSIE 8')>0)
    this.ie9 = (navigator.userAgent.indexOf('MSIE 9')>0)    
    this.ie10 = (navigator.userAgent.indexOf('MSIE 10')>0)    
    this.ieCE = (navigator.userAgent.indexOf('Windows CE')>0 || navigator.userAgent.indexOf('MSIE 6.0; Win32')>0); 
    if (this.ie5) this.v = 5
    if (this.ie6) this.v = 6
    if (this.ie7) this.v = 7
    if (this.ie8) this.v = 8
    if (this.ie9) this.v = 9  
    if (this.ie10) this.v = 10  
    this.min = (this.ns||this.ie)
}

// automatically create the "is" object
is = new BrowserCheck()


/* Handle login. */
function mymicrosLogin()
{
	document.getElementById("Login").src="/defaultStyleFamily/lite/images/Login-button-hilighted.png";
  // since 6.0.0
  // sending cookie from very first login. 	
  saveCookies(document.getElementById("usr").value, document.getElementById("cpny").value);

  var proceed = true;


  if (browserOK())
  {
  	if(is.ieCE)
  	{
  		proceed = true; 
  	}
  	else
  	{

	    if (!(isJavaInstalled()))
   		{
		    proceed = false;
    	}
    }
   if (proceed )
    {
      window.setTimeout("submitLoginForm()",50);
    }

  }
  else
  {

      alert("You need Internet Explorer 5.5 Service Pack 2 or later to view this page correctly. Please download it and try again.");
  }
}

function submitLoginForm()
{	var loginForm = document.getElementById("login");

    sUsr = document.getElementById("usr").value;
	if (! validateUserName( sUsr, "You are trying to log on, to do this you have to first\nenter your user name, company name and password.\n") ) return;
    sCpny = document.getElementById("cpny").value;
    if (! validateCompanyName( sCpny,  "You are trying to log on, to do this you have to first\nenter your user name, company name and password.\n")) return;
    sPwd = document.getElementById("pwd").value;
    if (! loginValidatePassword( sPwd, "You are trying to log on, to do this you have to first\nenter your user name, company name and password.\n")) return;


    document.getElementById("login").action.value = "login";
    document.getElementById("login").submit();

    // Setup timeout to come back gracefully if there's no response.
    window.setTimeout("noServerResponse()",30*1000);


}

/* Handle requesting getting a password hint. */
