{

  submitPasswordHintForm();
}

function submitPasswordHintForm()
{
    var loginForm = document.getElementById("login");

    sUsr = document.getElementById("usr").value;
    if (! validateUserName( sUsr, "You are trying to get your password hint, to do this you have\nto first enter both your user name and company's name.\n") ) return;
    sCpny = document.getElementById("cpny").value;
    if (! validateCompanyName( sCpny, "You are trying to get your password hint, to do this you have\nto first enter both your user name and company's name.\n")) return;

