function validateUserName( sUsr, EMsg )
{
  var iUSize = (sUsr ? sUsr.length : 0);



  // Require and validate user name structure
  if (!sUsr || !validateStringNotEmpty(sUsr))
  {
    alert(EMsg+"Please enter your user name.");
    document.getElementById("usr").focus();
    return false;
  }

  for (var i = 0; i<iUSize; i++)
    if(invalidCh.indexOf(sUsr.charAt(i)) != -1)
    {
        alert(EMsg + "Please enter a valid user name.");
        document.getElementById("usr").focus();
        return false;
    }
  return true;
}

function validateCompanyName( sCpny, EMsg )
{
  var iCSize = (sCpny ? sCpny.length : 0);
   // Require and validate company
  if (!sCpny)
  {
    alert(EMsg + "Please enter your company's name.");
    document.getElementById("cpny").focus();
    return false;
  }

  for (var i = 0; i<iCSize; i++)
      if(invalidCh.indexOf(sCpny.charAt(i)) != -1)
      {
        alert(EMsg+"Please enter a valid company name.");
        document.getElementById("cpny").focus();
        return false;
      }
  return true;
}

function loginValidatePassword( sPwd, EMsg )
{
  var iPSize = (sPwd ? sPwd.length : 0);

  // Require and validate password structure
  if (!sPwd || !validateStringNotEmpty(sPwd))
  {
    alert(EMsg+"Please enter your password.");
    loginForm.pwd.focus();
    return false;
  }

  if(!validatePassword(sPwd))
  {
        alert(EMsg+"Please enter a valid password.");
        loginForm.pwd.focus();
        return false;  
  }

  return true;
}

function validateStringNotEmpty(searchStr)
{
     if(searchStr.length > 0)
     {
        foundCharOrDigit = false;
        for(k= 0; k < searchStr.length; k++)
        {
            if(searchStr.charAt(k) != " ")
            {
                foundCharOrDigit = true;
                break;
            }
        }
       if(!foundCharOrDigit)
        {
            return false;
        }
    }
    else
    {
        return false;
    }
    return true;
}


function showIt()
{
	document.getElementById("usr").onkeypress = captureKey;
    document.getElementById("cpny").onkeypress = captureKey;
    document.getElementById("pwd").onkeypress = captureKey;
}

function captureKey(evt)
{
    var iKeyCode = null;
    // *** ??? the context seems to change, if is.ie/is.ns are used
    if (document.all)
        iKeyCode = window.event.keyCode;
    else
        iKeyCode = evt.which;

    if (iKeyCode == 13)
        mymicrosLogin();
}

function isJavaInstalled()
{
    var result = false;

    try
    {   
    	//var plugin = new ActiveXObject("JavaPlugin");
		var javaVersion = NewPluginDetect.getVersion('Java');
    	var ok;
    	if (javaVersion == null)
    	{
    		ok = PluginDetect.isMinVersion('Java', '1,4,2'); // detect Java plug-in (version 1.4.2 or greater)
    	}
    	else
    	{
			ok = NewPluginDetect.isMinVersion('Java', '1,4,2'); // detect Java plug-in (version 1.4.2 or greater)
		}
		if ( ok==0 || ok==1) { // Java plugin detected
    		result = true;
		}
		else {
			throw "No Java detected";
		}
    }
    catch(e)
    {
	    alert("The Sun Java Virtual Machine is required to use the portal. \n You will be prompted to download the latest version.");
        location.replace("http://java.com/java/download");
    }

    return result;
}

