<script type="text/javascript">

function getCookie (cookieName)
{
    var cookieValue = null;
    var posName = document.cookie.indexOf(escape(cookieName) + '=');
    if (posName != -1)
    {
       var posValue = posName + (escape(cookieName) + '=').length;
       var endPos = document.cookie.indexOf(';', posValue);
       if (endPos != -1)
           cookieValue = unescape(document.cookie.substring(posValue, endPos));
       else
           cookieValue = unescape(document.cookie.substring(posValue));
    }
    return cookieValue;
}

function getUserNameFromCookie()
{
     uName = getCookie("userName");
     if(uName != null)
         document.getElementById("usr").value = uName;
     return uName;
}

function getUserCompannyFromCookie()
{
     uCompany = getCookie("userCompany");
     if(uCompany != null)
        document.getElementById("cpny").value = uCompany;
     return uCompany;

}

function swapImage(elem, newImg)
{
	document.getElementById(elem).src = newImg;
}

function focusText(el)
{

	if(el.createTextRange && !is.ie10)
	{
		el.focus();
		el.value = el.value;
	}
	else
	{
		var len = el.value.length;
		el.selectionStart = len;
		el.selectionEnd = len;
		el.focus();
	}
}

