        document.getElementById("usr").focus();
        return false;
    }
  return true;
}

function validateCompanyName( sCpny, EMsg )
{
  var iCSize = (sCpny ? sCpny.length : 0);
   // Require and validate company
  if (!sCpny)
  {
    alert(EMsg + "Please enter your company's name.");
    document.getElementById("cpny").focus();
    return false;
  }

  for (var i = 0; i<iCSize; i++)
      if(invalidCh.indexOf(sCpny.charAt(i)) != -1)
      {
        alert(EMsg+"Please enter a valid company name.");
        document.getElementById("cpny").focus();
        return false;
      }
  return true;
}

function loginValidatePassword( sPwd, EMsg )
{
  var iPSize = (sPwd ? sPwd.length : 0);

  // Require and validate password structure
  if (!sPwd || !validateStringNotEmpty(sPwd))
  {
    alert(EMsg+"Please enter your password.");
    loginForm.pwd.focus();
    return false;
  }

  if(!validatePassword(sPwd))
  {
        alert(EMsg+"Please enter a valid password.");
        loginForm.pwd.focus();
        return false;  
  }

  return true;
}

function validateStringNotEmpty(searchStr)
{
     if(searchStr.length > 0)
     {
        foundCharOrDigit = false;
        for(k= 0; k < searchStr.length; k++)
        {
            if(searchStr.charAt(k) != " ")
            {
                foundCharOrDigit = true;
                break;
            }
        }
       if(!foundCharOrDigit)
        {
            return false;
        }
    }
    else
    {
        return false;
    }
    return true;
}


