<script type="text/javascript">

function getCookie (cookieName)
{
    var cookieValue = null;
    var posName = document.cookie.indexOf(escape(cookieName) + '=');
    if (posName != -1)
    {
       var posValue = posName + (escape(cookieName) + '=').length;
       var endPos = document.cookie.indexOf(';', posValue);
       if (endPos != -1)
           cookieValue = unescape(document.cookie.substring(posValue, endPos));
       else
           cookieValue = unescape(document.cookie.substring(posValue));
    }
    return cookieValue;
}

function getUserNameFromCookie()
{
     uName = getCookie("userName");
     if(uName != null)
         document.getElementById("usr").value = uName;
     return uName;
}

function getUserCompannyFromCookie()
{
     uCompany = getCookie("userCompany");
     if(uCompany != null)
        document.getElementById("cpny").value = uCompany;
     return uCompany;

}

function swapImage(elem, newImg)
{
	document.getElementById(elem).src = newImg;
}

function focusText(el)
{

	if(el.createTextRange && !is.ie10)
	{
		el.focus();
		el.value = el.value;
	}
	else
	{
		var len = el.value.length;
		el.selectionStart = len;
		el.selectionEnd = len;
		el.focus();
	}
}

function onclick_inMotion(choice)
{
    var isIpad = (navigator.userAgent.toLowerCase().indexOf('ipad')!=-1);
    var isIphone = (navigator.userAgent.toLowerCase().indexOf('iphone')!=-1);
    var isAndroid = (navigator.userAgent.toLowerCase().indexOf('android')!=-1);
    var isBlackBerry = (navigator.userAgent.toLowerCase().indexOf('blackberry')!=-1);

    if(choice == 1)
    {
	    ga('send', 'event', 'Get inMotion', 'Clicked', 'Get from App Store', {'page': '/login.jsp'});

	    if(isIpad || isIphone || isAndroid || isBlackBerry)
	        document.location.href='https://itunes.apple.com/us/app/micros-inmotion/id605646275?mt=8';
	    else
	        window.open('https://itunes.apple.com/us/app/micros-inmotion/id605646275?mt=8');
	}
	else if(choice == 2)
	{
	    ga('send', 'event', 'Get inMotion', 'Clicked', 'Get from Play Store', {'page': '/login.jsp'});

	    if(isIpad || isIphone || isAndroid || isBlackBerry)
	        document.location.href='http://play.google.com/store/apps/details?id=com.micros.inmotion';
	    else
	        window.open('http://play.google.com/store/apps/details?id=com.micros.inmotion');	
	}
}

